import React from 'react';
import classes from './PortfolioItem.css';

const portfolio = () => (
    <div className={classes.PortfolioItem}>
        <h1>Page about Space</h1>
        <img src='../../../Assets/Images/GalaxusPreview' alt='Galaxus page'/>
    </div>
);

export default portfolio;
